BlocklyGamesMsg["Movie.helpLayer"] = "Di chuyển nền hình tròn lên phần đầu của chương trình. Sau đó nó sẽ xuất hiện phía sau nhân vật.";
BlocklyGamesMsg["Movie.helpText1"] = "Sử dụng các khối hình đơn giản để vẽ người này.";
BlocklyGamesMsg["Movie.helpText2a"] = "Cấp độ này là một đoạn phim. Bạn muốn cánh tay của nhân vật di chuyển qua màn hình. Nhấn nút chơi để xem chương trình chạy.";
BlocklyGamesMsg["Movie.helpText2b"] = "Khi đoạn phim được chiếu, giá trị của mảnh 'thời gian' đếm từ 0 đến 100.\nBạn muốn cho vị trí nằm ngang của cánh tay bắt đầu tại 0 và đi đến 100.";
BlocklyGamesMsg["Movie.helpText3"] = "Mảnh 'thời gian' đếm từ 0 đến 100. Nhưng bây giờ bạn muốn vị trí nằm ngang của cánh tay bắt đầu tại 100 và đi đến 0. Bạn hãy tìm ra công thức toán đơn giản để đổi hướng đếm.";
BlocklyGamesMsg["Movie.helpText4"] = "Sử dụng những gì bạn đã học trong những cấp độ trước để làm sao cho những cái chân bắt chéo nhau.";
BlocklyGamesMsg["Movie.helpText5"] = "Phép toán cho cánh tay khá phức tạp. Đây là câu trả lời:";
BlocklyGamesMsg["Movie.helpText6"] = "Đưa cho nhân vật hai bàn tay.";
BlocklyGamesMsg["Movie.helpText7"] = "Sử dụng mảnh 'if' để vẽ một cái đầu nhỏ cho nửa đoạn đầu trình chiếu của phim. Sau đó vẽ một cái đầu lớn cho nửa đoạn sau của phim.";
BlocklyGamesMsg["Movie.helpText8"] = "Làm cho những cái chân thay đổi hướng ở giữa chặng của đoạn phim.";
BlocklyGamesMsg["Movie.helpText9"] = "Vẽ một vòng tròn mở rộng đằng sau nhân vật.";
BlocklyGamesMsg["Movie.helpText10"] = "Tạo ra phim về mọi thứ bạn muốn. Bạn có thể khám phá cùng với một số lượng lớn mảnh mới. Chúc bạn vui vẻ.";
BlocklyGamesMsg["Movie.helpText10Reddit"] = "Sử dụng \"Xem Phòng trưng bày\" nhấn để xem những người khác đã thiết kế. Nếu bạn vẽ nên đoạn phim đặc sắc, hãy dùng \"Gửi đến Phòng trưng bày\" nhấn để trưng bày nó.";
BlocklyGamesMsg["Music.playNoteTooltip"] = "Chơi một nốt nhạc trong một khoảng thời gian và cao độ nhất định.";
