BlocklyGamesMsg["Music.helpUseFunctions"] = "Giải pháp tốt, nhưng vẫn có thể được cải thiện. Sử dụng các hàm để giảm số lượng các phần lặp lại.";
BlocklyGamesMsg["Music.helpUseInstruments"] = "Bản nhạc sẽ trở nên tốt hơn nếu bạn sử dụng một nhạc cụ khác cho phần khởi đầu của mỗi khối ghép.";
BlocklyGamesMsg["Music.helpText1"] = "Biên soạn bốn nốt đầu tiên của \"Kìa con bướm vàng\".";
BlocklyGamesMsg["Music.helpText2a"] = "Một 'function' cho phép bạn nhóm các mảnh ghép lại với nhau, sau đó chạy các mảnh đó nhiều lần.";
BlocklyGamesMsg["Music.helpText2b"] = "Tạo một hàm để chơi bốn nốt đầu của \"Kìa con bướm vàng\". Chạy hàm vừa tạo hai lần. Đừng thêm bất cứ khối nốt nào.";
BlocklyGamesMsg["Music.helpText3"] = "Tạo hàm thứ hai cho phần tiếp theo của \"Kìa con bướm vàng\". Nốt cuối cùng dài hơn.";
BlocklyGamesMsg["Music.helpText4"] = "Tạo một hàm thứ ba cho phần tiếp theo của \"Kìa con bướm vàng\". Bốn nốt đầu tiên ngắn hơn.";
BlocklyGamesMsg["Music.helpText5"] = "Hoàn chỉnh toàn bộ âm điệu của \"Kìa con bướm vàng\".";
BlocklyGamesMsg["Music.helpText6a"] = "Khối ghép này cho phép bạn thay đổi sang một nhạc cụ khác.";
BlocklyGamesMsg["Music.helpText6b"] = "Chạy bản nhạc của bạn với một cây vi-ô-lông.";
BlocklyGamesMsg["Music.helpText7a"] = "Khối ghép này tạo ra một đoạn im lặng.";
BlocklyGamesMsg["Music.helpText7b"] = "Tạo khối bắt đầu thứ hai bao gồm hai mảnh tạm dừng, sau đó chơi \"Kìa con bướm vàng\".";
BlocklyGamesMsg["Music.helpText8"] = "Mỗi mảnh ghép khởi đầu nên chơi \"Kìa con bướm vàng\" hai lần.";
BlocklyGamesMsg["Music.helpText9"] = "Tạo bốn mảnh khởi đầu, mỗi mảnh chơi \"Kìa con bướm vàng\" hai lần. Thêm chính xác số mảnh tạm dừng.";
BlocklyGamesMsg["Music.helpText10"] = "Sáng tác bất cứ thứ gì bạn muốn. Bạn có thể khám phá với một số lượng lớn của những mảnh ghép mới. Chúc bạn vui vẻ!";
BlocklyGamesMsg["Music.helpText10Reddit"] = "Sử dụng nút \"Xem Bộ sưu tập\" để xem tác phẩm của những người đã sáng tác. Nếu bạn đã sáng tác nên một thứ thú vị, hãy nhấn \"Gửi đến Bộ sưu tập\" để công bố nó.";
BlocklyGamesMsg["Pond.scanTooltip"] = "Thăm dò địch thủ. Xác định hướng (0-360). Hoàn lại khoảng cách đến địch thủ gần nhất theo hướng đó. Hoàn lại vô tận nếu không có địch thủ nào bị ngắm.";
BlocklyGamesMsg["Pond.cannonTooltip"] = "Bắn súng. Xác định hướng (0-360) và phạm vi (0-70).";
BlocklyGamesMsg["Pond.swimTooltip"] = "Bơi về phía trước. Xác định hướng (0-360).";
BlocklyGamesMsg["Pond.stopTooltip"] = "Ngưng bơi. Người chơi sẽ chậm dần đến khi dừng hẳn.";
BlocklyGamesMsg["Pond.healthTooltip"] = "Hoản trả năng lượng hiện tại của người chơi ( 0 là chết, 100 là khỏe mạnh).";
