BlocklyGamesMsg["Pond.targetName"] = "Mục tiêu";
BlocklyGamesMsg["Pond.pendulumName"] = "Quả lắc đồng hồ";
BlocklyGamesMsg["Pond.scaredName"] = "Kinh hãi";
BlocklyGamesMsg["Pond.helpUseScan"] = "Giải pháp của bạn hoạt động, nhưng bạn có thể làm tốt hơn. Sử dụng 'scan' để khẩu pháo biết được khoảng cách để bắn.";
BlocklyGamesMsg["Pond.helpText1"] = "Sử dụng lệnh 'cannon' để đánh trúng mục tiêu. Tham số đầu tiên là góc, tham số thứ hai là phạm vi. Tìm sự kết hợp phù hợp.";
BlocklyGamesMsg["Pond.helpText2"] = "Mục tiêu này cần bị đánh trúng nhiều lần. Sử dụng vòng lặp 'while (true)' để thực hiện điều gì đó vô thời hạn.";
BlocklyGamesMsg["Pond.helpText3a"] = "Đối thủ này di chuyển qua lại, khiến việc đánh trúng trở nên khó khăn hơn. 'Scan' trả về phạm vi chính xác của đối thủ trong một hướng nhất định.";
BlocklyGamesMsg["Pond.helpText3b"] = "Đây chính là phạm vi lệnh 'cannon' cần để bắn một cách chính xác.";
BlocklyGamesMsg["Pond.helpText4"] = "Đối thủ này quá xa để sử dụng khẩu pháo (có giới hạn 70 mét). Thay vào đó, sử dụng lệnh 'swim' để bắt đầu bơi về phía đối thủ và đâm vào nó.";
BlocklyGamesMsg["Pond.helpText5"] = "Đối thủ này cũng quá xa để sử dụng khẩu pháo. Nhưng bạn quá yếu để tồn tại một vụ va chạm. Bơi về phía đối thủ trong khi vị trí nằm ngang của bạn nhỏ hơn 50. Sau đó 'stop' và sử dụng khẩu pháo.";
BlocklyGamesMsg["Pond.helpText6"] = "Đối thủ này sẽ di chuyển đi khi nó bị bắn trúng. Bơi về phía nó nếu nó nằm ngoài phạm vi (70 mét).";
